import { Container } from "react-bootstrap";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import TelaCadastroDeUsuario from "./Screen/TelaDeCadastroDeUsuario";
import TelaCadastroDeQuadras from "./Screen/TelaDeCasdastroDeQuadras";
import TelaCadastroDeReserva from "./Screen/TelaCadastroDeReserva";
import TelaMenu from "./Screen/TelaMenu";
import Tela404 from "./Screen/Tela404";
import TelaLogin from "./Screen/TelaLogin";
import ProtectedRoute from "./Screen/ProtectedRoute";

const App = () => {
  const isAuthenticated = false; // Defina se o usuário está autenticado ou não

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<TelaLogin />} />
        <ProtectedRoute
          path="/menu"
          element={<TelaMenu />}
          isAuthenticated={isAuthenticated}
        />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
